import React, { useEffect, useState } from 'react';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';

export default function MyOrder() {
  const [orderData, setOrderData] = useState([]);

  const fetchMyOrder = async () => {
    try {
      const userEmail = "Krishna123@gmail.com"; // Use the actual email or fetch it from your storage
      const response = await fetch(`http://localhost:5000/api/myOrderData?email=${userEmail}`);

      if (response.ok) {
        const data = await response.json();
        setOrderData(data);
      } else {
        console.error('Failed to fetch order data');
      }
    } catch (error) {
      console.error('Error fetching order data:', error);
    }
  };

  useEffect(() => {
    fetchMyOrder();
  }, []);

  return (
    <>
      <div>
        <Navbar />
      </div>

      <div className='container'>
        <div className='row'>
          {orderData.length > 0 ? (
            orderData.map((order) => (
              <div key={order._id} className='col-12 col-md-6 col-lg-3'>
                <div className="card mt-3" style={{ width: "16rem", maxHeight: "360px" }}>
                  <div className="card-body">
                    <h5 className="card-title">Order Details</h5>
                    <p>Email: {order.email}</p>
                    <p>Order Date: {new Date(order.order_date).toLocaleString()}</p>
                    <hr />
                    <h6>Order Items:</h6>
                    <ul>
                      {order.order_data.map((item, index) => (
                        <li key={index}>
                          {/* Display individual order item details here */}
                          {/* You can access item properties like item.propertyName */}
                        </li>
                      ))}
                    </ul>
                  </div>
                </div>
              </div>
            ))
          ) : (
            <p>No orders found.</p>
          )}
        </div>
      </div>

      <Footer />
    </>
  );
}
